import React from 'react';

const FaceRecognition = ({imageURL}) => {
	return(
		<div className='center ma'>
			<div className='absolute mt3'>
			<img id='inputImage' alt='photo' src={imageURL} width='500px' height='auto'/>
			</div>
		</div>
	);
}

export default FaceRecognition;
